import React, {Component} from 'react';
import skills from './skills'
import battleSkills from './battleSkills'

class Skills extends Component{
    // constructor(){
    //     super();
    // }

    render(){
        const battleRow = battleSkills.map
        const skillRow = skills.map((skill,i)=>{
            return(
                <tr key={i}>
                    <td>{skill.category}</td>
                    <td>{skill.name}</td>
                    <td>{skill.initValue}</td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                    <td><input /></td>
                </tr>
            )
        })

        return(
            <div>
                <h2>Sample</h2>
                <table>
                    <tr>
                        <td>カテゴリ</td>
                        <td>技能名</td>
                        <td>初期値</td>
                        <td>職業P</td>
                        <td>興味P</td>
                        <td>成長</td>
                        <td>その他</td>
                        <td>合計値</td>
                    </tr>
                    {skillRow}
                </table>
            </div>
        )
    }
}

export default Skills;
